import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after entering search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_term.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_term.png'));

    // Wait for the search button (first visible one)
    const searchBtn = await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Click the search button
    await searchBtn.click();

    // Wait for search results header to appear
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract product titles containing 'iPhone'
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.map(n => n.innerText).filter(title => /iphone/i.test(title))
    );

    // Extract number of search results (from .results-count)
    let resultsCountText = '';
    const resultsCountHandle = await page.$('.results-count');
    if (resultsCountHandle) {
      resultsCountText = await resultsCountHandle.innerText();
    }

    return {
      success: true,
      action: "Searched for 'iPhone' products and captured search results",
      extractedData: {
        productTitles,
        resultsCountText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
